import React, { Component } from 'react';
import Footer from './components/Footer';
import About from './components/About';

  export default class Index extends Component {

    constructor(props) {
      super(props);
    }

  	render() {

      return (
        <div>
          <Footer />
          <About />
        </div>
      )
    }
  }

